import React, {Component} from 'react'

class Entryitem extends Component{
    render() {
        return(
            <>
               <div className="entry-item">
                        <div className="entry-item-img">
                           <img
                                src="//m.360buyimg.com/babel/s86x86_jfs/t1/66255/7/1579/4738/5cfe300dE50487936/ec2699b670750e51.jpg!q70.dpg"
                                className="lazyload-img big-width loaded" data-resize="1"
                                style="background-color: transparent; background-image: none;"/>
                        </div>
                        <div className="entry-item-name">123</div>
                </div>
            </>
        );
    }
}
export default Entryitem;
